import './style/reset.scss';
import { mapGetters } from "vuex";
import getTimeRemaining from "./functions/getTimeRemaining.js";
export default {
  computed: {
    ...mapGetters("global", ["getDate"]),
    ...mapGetters("authentication", ["getCountdown"]),
    timeLeft() {
      let timeRemaining = getTimeRemaining(this.getCountdown.time, this.getDate);
      return timeRemaining.total > 0 ? timeRemaining : {
        days: 0,
        hours: 0,
        minutes: 0,
        seconds: 0
      };
    }
  }
};
